import React from 'react'


function ListItem(props, readonly){
    const item = props.item
    console.log ("id",item.id ,"title: ", item.title)
    
     
    return(
        <li
        key={item.id}
        value={item.title}
        className="list-item"
        onClick={() => props.click(item.title)}
    >
        <div>
            {item.title}
        </div>
        <div className="item-amount">
            {item.amount}
        </div>
    </ li >
)
}
            
export default ListItem
